import Link from 'next/link';

export default function Index() {
    return (
        <div>
            <div>
                <p>Fakeblock: a Facebook Frontend Alternative</p>
            </div>
            <div>
              <Link href="/about">
                  <a Title={"About Page"}> About Page </a>
              </Link>
            </div>
        </div>
    );
}
